package daytwo;

public class Gugudantwo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j,result;
		for(i=1;i<=9;i++)
		{
			for(j=1;j<=9;j++)
			{
				result=j*i;
				System.out.print(j+"*"+i+"="+result+"\t");
			}
			System.out.println();
		}

	}

}
